// Projects.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import tunermenucamber from './tuner-menu-camber.png';
import paragonPreview from '../assets/paragon-preview.png';
import { motion } from 'framer-motion';

const Projects: React.FC = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.3
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1
    }
  };

  return (
    <motion.section
      initial="hidden"
      animate="visible"
      variants={containerVariants}
      className="min-h-screen pt-24 pb-12 px-4"
    >
      <div className="max-w-6xl mx-auto">
        <div className="glass-effect rounded-xl p-8">
          {/* Header */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="text-center mb-12"
          >
            <h2 className="text-4xl font-bold text-white mb-4">
              Featured Projects
            </h2>
            <p className="text-gray-300 text-lg">
              Explore my portfolio of web applications and development projects
            </p>
          </motion.div>

          {/* Projects Grid */}
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 mb-12">
            {/* Portfolio Website Project */}
            <motion.div 
              variants={itemVariants} 
              className="bg-slate-800/50 p-6 rounded-xl hover:bg-slate-700/50 transition-all duration-300 transform hover:-translate-y-1"
            >
              <div className="flex justify-center mb-6">
                <div className="relative w-full h-64 rounded-lg overflow-hidden">
                  <div className="absolute inset-0 bg-gradient-to-br from-slate-800/50 to-slate-900/50 z-10"></div>
                  <img 
                    src={paragonPreview}
                    alt="Portfolio Website" 
                    className="w-full h-full object-cover rounded-lg" 
                  />
                </div>
              </div>
              <div className="text-center">
                <h3 className="text-xl font-bold mb-3 text-white">Portfolio Website</h3>
                <p className="text-gray-300 mb-4">A modern, responsive portfolio built with React and TypeScript</p>
                <Link 
                  to='/portfolio-project' 
                  className="inline-block px-6 py-3 bg-primary/80 text-white font-semibold rounded-lg hover:bg-primary transition-all duration-300"
                >
                  View Project
                </Link>
              </div>
            </motion.div>

            {/* FiveM Project */}
            <motion.div 
              variants={itemVariants} 
              className="bg-slate-800/50 p-6 rounded-xl hover:bg-slate-700/50 transition-all duration-300 transform hover:-translate-y-1"
            >
              <div className="flex justify-center mb-6">
                <div className="relative w-full h-64 rounded-lg overflow-hidden">
                  <div className="absolute inset-0 bg-gradient-to-br from-slate-800/50 to-slate-900/50 z-10"></div>
                  <img 
                    src={tunermenucamber} 
                    alt="FiveM Project" 
                    className="w-full h-full object-cover rounded-lg" 
                  />
                </div>
              </div>
              <div className="text-center">
                <h3 className="text-xl font-bold mb-3 text-white">FiveM Vehicle Tuning Interface</h3>
                <p className="text-gray-300 mb-4">A custom UI for vehicle tuning in FiveM servers</p>
                <Link 
                  to='/project1' 
                  className="inline-block px-6 py-3 bg-primary/80 text-white font-semibold rounded-lg hover:bg-primary transition-all duration-300"
                >
                  View Project
                </Link>
              </div>
            </motion.div>
          </div>

          {/* Portfolio Repository Link */}
          <motion.div 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.6 }}
            className="text-center border-t border-slate-700/50 pt-8"
          >
            <p className="text-gray-300 font-semibold mb-4">
              View the repository for this Website Portfolio
            </p>
            <a 
              href="https://github.com/dasz4376/portfolio" 
              target="_blank"
              rel="noopener noreferrer"
              className="inline-block px-6 py-3 bg-primary/80 text-white font-semibold rounded-lg hover:bg-primary transition-all duration-300"
            >
              View Repository
            </a>
          </motion.div>
        </div>
      </div>
    </motion.section>
  );
}

export default Projects;
